import React from 'react'

import { NavLink } from 'react-router-dom'

export default function Product() {
  return (

    <>
      <div>Product</div>
      <nav>
        <NavLink to='/Feature'>Featured</NavLink>
        <NavLink to=''>New</NavLink>
      </nav>
    </>
  )
}
